--
-- Create procedure `Proc_GetPagingFood`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetPagingFood (IN pageIndex int, IN pageSize int, IN whereClause varchar(255), IN sortBy varchar(255), IN sortType varchar(255))
COMMENT 'Lấy món ăn theo phân trang, lọc'
BEGIN
  DECLARE _OFFSET int;
  DECLARE _LIMIT int;
  SET _LIMIT = pageSize;
  SET _OFFSET = (pageIndex - 1) * pageSize;

  CREATE TEMPORARY TABLE IF NOT EXISTS `tmpTable` (
    FoodId char(36),
    FoodCode varchar(100),
    FoodName varchar(255),
    FoodUnitId char(36),
    FoodGroupId char(36),
    ProcessedPlaceId char(36),
    FoodPrice decimal(18, 4),
    FoodInvest decimal(18, 4),
    Description varchar(255),
    ShowOnMenu int,
    ImageUrl varchar(255),
    CreatedDate datetime,
    FoodUnitName varchar(100),
    FoodGroupName varchar(100),
    ProcessedPlaceName varchar(100)
  );

  INSERT INTO `tmpTable`
    SELECT
      f.FoodId,
      f.FoodCode,
      f.FoodName,
      f.FoodUnitId,
      f.FoodGroupId,
      f.ProcessedPlaceId,
      f.FoodPrice,
      f.FoodInvest,
      f.Description,
      f.ShowOnMenu,
      f.ImageUrl,
      f.CreatedDate,
      fu.FoodUnitName,
      fg.FoodGroupName,
      pp.ProcessedPlaceName
    FROM food f
      LEFT JOIN `foodunit` fu
        ON f.FoodUnitId = fu.FoodUnitId
      LEFT JOIN `foodgroup` fg
        ON f.FoodGroupId = fg.FoodGroupId
      LEFT JOIN `processedplace` pp
        ON f.ProcessedPlaceId = pp.ProcessedPlaceId;

  SET @Query = CONCAT('SELECT * FROM `tmpTable` ', whereClause, ' ORDER BY ', sortBy, ' ', sortType, ' LIMIT ', _LIMIT, ' OFFSET ', _OFFSET);
  PREPARE FoodFilter FROM @Query;
  EXECUTE FoodFilter;
  DEALLOCATE PREPARE FoodFilter;

  SET @Query = CONCAT('SELECT COUNT(FoodId) FROM `tmpTable` ', whereClause);
  PREPARE TotalRecord FROM @Query;
  EXECUTE TotalRecord;
  DEALLOCATE PREPARE TotalRecord;
END
$$

--
-- Create procedure `Proc_GetById_Food`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetById_Food (IN FoodId char(36))
COMMENT 'Lấy món ăn theo id'
BEGIN
  SELECT
    f.*,
    fu.FoodUnitName,
    fg.FoodGroupName,
    pp.ProcessedPlaceName
  FROM Food f
