CREATE
DEFINER = 'dev'@'%'
VIEW view_food
AS
SELECT
  `f`.`FoodId` AS `FoodId`,
  `f`.`FoodCode` AS `FoodCode`,
  `f`.`FoodName` AS `FoodName`,
  `f`.`FoodUnitId` AS `FoodUnitId`,
  `fu`.`FoodUnitName` AS `FoodUnitName`,
  `f`.`FoodGroupId` AS `FoodGroupId`,
  `fg`.`FoodGroupName` AS `FoodGroupName`,
  `f`.`ProcessedPlaceId` AS `ProcessedPlaceId`,
  `pp`.`ProcessedPlaceName` AS `ProcessedPlaceName`,
  `f`.`FoodPrice` AS `FoodPrice`,
  `f`.`FoodInvest` AS `FoodInvest`,
  `f`.`Description` AS `Description`,
  `f`.`ShowOnMenu` AS `ShowOnMenu`,
  `f`.`ImageUrl` AS `ImageUrl`,
  `f`.`CreatedDate` AS `CreatedDate`
FROM (((`food` `f`
  LEFT JOIN `foodunit` `fu`
    ON ((`f`.`FoodUnitId` = `fu`.`FoodUnitId`)))
  LEFT JOIN `foodgroup` `fg`
    ON ((`f`.`FoodGroupId` = `fg`.`FoodGroupId`)))
  LEFT JOIN `processedplace` `pp`
    ON ((`f`.`ProcessedPlaceId` = `pp`.`ProcessedPlaceId`)));

