--
-- Create procedure `Proc_GetByFoodId_ServiceHobby`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_GetByFoodId_ServiceHobby (IN FoodId char(36))
COMMENT 'Lấy toàn bộ sở thích phục vụ theo foodId'
BEGIN
  SELECT
    fsh.FoodId,
    f.FoodName,
    fsh.ServiceHobbyId,
    sh.ServiceHobbyName,
    sh.Fee
  FROM FoodServiceHobby fsh
    JOIN ServiceHobby sh
      ON fsh.ServiceHobbyId = sh.ServiceHobbyId
    JOIN Food f
      ON fsh.FoodId = f.FoodId
  WHERE fsh.FoodId = FoodId;
END
$$

