--
-- Create procedure `Proc_CheckDuplicate`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_CheckDuplicate (IN Id char(36), IN Text varchar(255), IN ColumnName varchar(255), IN TableName varchar(255))
COMMENT 'Kiểm tra trùng mã món ăn, tên đơn vị.....'
BEGIN
  SET @Query = CONCAT('SELECT ', ColumnName, ' FROM ', TableName, ' WHERE ', ColumnName, ' = ', '"', Text, '"', ' AND ', TableName, 'Id', ' != ', '"', Id, '"');
  PREPARE valueReturn FROM @Query;
  EXECUTE valueReturn;
  DEALLOCATE PREPARE valueReturn;
END
$$

